import React from 'react'
import styled from 'styled-components';

function Game() {
    return (
        <Container>
            <ContainerChildLeft>
                <p>Department</p>
                <p>Computers</p>
                <p>Computer Accessories & Peripherals</p>
                <p>Computer Components</p>
                <p>Computers & Tablets</p>
                <p>Data Storage</p>
                <p>Laptop Accessories</p>
                <p>Monitors</p>
                <p>Networking Products</p>
                <p>Power Strips & Surge Protectors</p>
                <p>Printers</p>
                <p>Scanners</p>
                <p>Servers</p>
       
            </ContainerChildLeft>
            <ContainerChildRight>
                right
            </ContainerChildRight>
        </Container>
    )
}

export default Game

const Container = styled.div`
    display: flex;
`

const ContainerChildLeft = styled.div`
    background-color: white;
    padding:10px;
    border-right:1px solid black;
    
`

const ContainerChildRight = styled.div`
    display: flex;
    
    background-color: red;
    flex-grow:1;
    padding:10px;
`
